INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (5.18, 3, "2025/01/31 12:00:00", 101, "2030/01/01 14:59:59", -6.0, 61, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 1020101, -285.0, 133701, "ラビリスタ", 10201, 7);
