INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (15.5, 6, "2025/01/31 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1020103, -285.0, 133801, "ネネカ", 10201, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (9.061, 2, "2025/02/28 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 1020201, -285.0, 134301, "ランファ", 10202, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7.699, 1, "2025/02/28 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 1020202, -285.0, 134401, "チカ", 10202, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.595, 1, "2025/03/31 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 1020301, -285.0, 134601, "アオイ", 10203, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7.758, 1, "2025/03/31 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 1020302, -285.0, 134501, "クローチェ", 10203, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7.0, 2, "2025/04/30 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 1020401, -285.0, 132302, "ルイズマリー", 10204, 6);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7.904, 1, "2025/04/30 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 1020402, -285.0, 132402, "イロハ", 10204, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.487, 4, "2025/04/30 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 1020403, -285.0, 132502, "ソノ", 10204, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.763, 1, "2025/05/31 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 1020502, -285.0, 134901, "カノン", 10205, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6.417, 1, "2025/05/31 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 1020503, -285.0, 134801, "ツムギ", 10205, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10.335, 3, "2025/06/30 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 1020601, -285.0, 135001, "エリス", 10206, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6.281, 2, "2025/06/30 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 1020602, -285.0, 135101, "シェフィ", 10206, 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (12.244, 1, "2025/06/30 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 1020603, -285.0, 135201, "プレシア", 10206, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6.339, 2, "2025/07/31 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 1020701, -285.0, 135301, "クリア", 10207, 8);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.184, 7, "2025/07/31 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 1020702, -285.0, 135401, "アネモネ", 10207, 9);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (3.906, 9, "2025/08/31 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 1020801, -285.0, 129101, "アイラ", 10208, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (14.465, 1, "2025/08/31 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 1020802, -285.0, 129201, "シナツ", 10208, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.662, 4, "2025/08/31 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 1020803, -285.0, 100101, "ヒヨリ", 10208, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10.915, 1, "2025/08/31 12:00:00", 401, "2030/01/01 14:59:59", 0.0, 61, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 1020804, -285.0, 100301, "レイ", 10208, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6.042, 1, "2025/09/30 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 1020901, -285.0, 135802, "ユキノ", 10209, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (9.402, 4, "2025/09/30 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 1020902, -285.0, 135903, "サツキ", 10209, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.16, 8, "2025/09/30 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 1020903, -285.0, 136902, "ルルィ", 10209, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (5.0, 3, "2025/10/31 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 1021001, -285.0, 137401, "カスミ", 10210, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.12, 4, "2025/10/31 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 1021002, -285.0, 136001, "アラクネ", 10210, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6.386, 4, "2025/10/31 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 1021003, -285.0, 136202, "ナーナ", 10210, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7.438, 3, "2025/11/30 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 1021101, -285.0, 136402, "ユイ", 10211, 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (8.35, 1, "2025/11/30 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 1021102, -285.0, 136302, "ミソラ", 10211, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (5.0, 1, "2025/12/31 12:00:00", 101, "2030/01/01 14:59:59", 0.0, 61, "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 1021201, -285.0, 136501, "シズル", 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (5.25, 1, "2025/12/31 12:00:00", 201, "2030/01/01 14:59:59", 0.0, 61, "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 1021202, -285.0, 137902, "リノ", 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7.5, 1, "2025/12/31 12:00:00", 301, "2030/01/01 14:59:59", 0.0, 61, "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 1021203, -285.0, 106801, "ラビリスタ", 10212, 2);
